import React from 'react'
import './main.css';
import { Row, Col, Container } from 'react-bootstrap';



const Founder = () => {
    return(
        <Container>
            <p className='Head-founder'>Know a bit about our founder</p>
        <Row>
        <Col xs="12" md="6"className='Founder-sec Founder-img'> 
       
       </Col>
       <Col xs="12" md="6" className='Founder-info'> 
      
       </Col>
        </Row>
        </Container>
    )
}

export default Founder;
